import React, { useEffect } from 'react';

const singlePage = () => {
    const [posts, setPosts] = useState([]);
    useEffect(() => {
        fetch("http://localhost:4000/post").then(response => {
            response.json().then(posts => {
                setPosts(posts);
            })
        })
    }, []);
    return ( <React.Fragment>
        {posts.map( post =>(
            <h1>{post.title}</h1>
        ))}
    </React.Fragment> );
}
 
export default singlePage;
